export const about = () => {
    return (
        <BrowserRouter>
      <div className="about">
        <h1>About</h1>
        <h2>ここはaboutなんよ</h2>
        <Link to="/">Homemain</Link>
      </div>
      </BrowserRouter>
    );
  };
  
export default about


<BrowserRouter>
      <div>
        
        <Routes>
          <Route path="/about" element={<About />} />
          <Route path="/" element={<Homemain />} />
          <Route path="/Home" element={<Home />} />
          <Route path="/Page1" element={<Page1 />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
        
      
      </div>
